Asa Akira, Bridgette B., Jessie Volt, Kaylani Lei, Lea Lexis, Remy LaCroix, Samantha Saint,
Sophia Fiore, Summer Brielle ,Barrett Blade, Bill Bailey, Brad Armstrong, Dirk Huge, Eric Masterson, James Deen,
Jon Jon, Keni Styles, Kurt Lockwood, Rob Piper, Seth Gamble, Steven St. Croix,
Xander Corvus

Everyone has a secret...

Fresh off of the award winning and critically acclaimed features Underworld and Aftermath, director Brad Armstrong spins yet another dramatic tale.
With Holly ... Would, life is going great for high-end Los Angeles hooker Holly (Asa Akira)
and her private nightclub - &quot;The Club&quot;. That is, until her livelihood is threatened when someone drops a dime on her operation.
Undercover cops attempt to infiltrate the club, which leads to murder, deception and of course - heart pounding
sex! Fans of Armstrong, Akira, beautifully crafted storytelling and passionate sex will love Holly ... Would!

